import React from "react";

export default class EntityField extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <div className="entity-field">
                <div className="entity-field__label">{this.props.field.name}</div>
                <div className="entity-field__value">{this.props.value}</div>
            </div>
        )
    }
}
